import Navbar from '../../components/navbar';
import axios from "axios";
import React, { useState, useEffect } from "react";


function Characters() {
  useEffect(() => {
    axios
      .get(process.env.REACT_APP_API_KEY`/elements/filter`)
      .then((res) => {
        console.log(res)
      });
  }, []);
    return (
        <div className="App">
          <Navbar  />
          <div className="App-header">
            Test
          </div>
        </div>
      );
}

export default Characters;
